import ParticlesBg from 'particles-bg'
import { Component } from 'react';

class App extends Component {
  constructor(){
    super();
    this.state = {
      input: '',
    }
  } 

  onInputChange = (event) => {
    console.log(event.target.value)

  }

render(){
